  name: ISymbolReader
  nameWithType: ISymbolReader
  fullName: System.Diagnostics.SymbolStore.ISymbolReader
  type: Interface
  summary: "Представляет средство чтения символов для управляемого кода."
  remarks: "Интерфейс предоставляет доступ к документам, методам и переменным.      Настроек [!NOTE] настроек этот интерфейс является управляемым аналогом `ISymUnmanagedReader` интерфейса, один из интерфейсов хранилища неуправляемые символов, которые предоставляют альтернативный способ чтения и записи информации о символах отладки."
  syntax:
    content: >-
      [System.Runtime.InteropServices.ComVisible(true)]

      public interface ISymbolReader
